import "./App.css";
import axios from "axios";
import dotenv from "dotenv";

dotenv.config();
let key = process.env.REACT_APP_API_KEY

class App extends Component {
  async getData() {
   const url = `http://ws.audioscrobbler.com/2.0/?method=track.search&track=kygo&api_key=${API_KEY}&format=json`;

   let res = axios.get(url);
   console.log(res);
  }

  componentDidMount() {
   this.getData()
  }

  render() {
    return (
      <div>
        <h1>Music</h1>
      </div>
    );
  }
}

export default App;
